import FormControl from '@mui/material/FormControl';
import FormLabel from '@mui/material/FormLabel';
import FormGroup from '@mui/material/FormGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import { Button } from '@mui/base/Button';


function BookingForm({hallName, seatNum})
{
    const url = "http://localhost:5000/" + hallName + "/" + seatNum;
    return(
        <div>
            <h1>Book Your Seat</h1>
            <h2>Valid till the end of this year</h2>
            <form action={url} method="post">
                <div class="weekDays-selector">
                    <input type="checkbox" id="mon" value={0} class="weekday" />
                    <label for="weekday-mon">M</label>
                    <input type="checkbox" id="tue" class="weekday" />
                    <label for="weekday-tue">T</label>
                    <input type="checkbox" id="wed" class="weekday" />
                    <label for="weekday-wed">W</label>
                    <input type="checkbox" id="thu" class="weekday" />
                    <label for="weekday-thu">T</label>
                    <input type="checkbox" id="fri" class="weekday" />
                    <label for="weekday-fri">F</label>
                    <input type="checkbox" id="sat" class="weekday" />
                    <label for="weekday-sat">S</label>
                    <input type="checkbox" id="sun" class="weekday" />
                    <label for="weekday-sun">S</label>
                </div>
            <input type='text' value='aleema' name="username" />
            <FormControl sx={{ m: 3 }} component="fieldset" variant="standard">
                <FormLabel component="legend">Choose your Days</FormLabel>
                <FormGroup>
                    <FormControlLabel
                    control={
                    <Checkbox value={0} />
                    } label="M"
                    />
                 <FormControlLabel
                    control={
                    <Checkbox value={1} />
                    } label="T"
                    />
                 <FormControlLabel
                    control={
                    <Checkbox value={2} />
                    } label="W"
                    />   
                    <FormControlLabel
                    control={
                    <Checkbox value={3} />
                    } label="Th"
                    />    
                    <FormControlLabel
                    control={
                    <Checkbox value={4} />
                    } label="F"
                    /> 
                    <FormControlLabel
                    control={
                    <Checkbox value={5} />
                    } label="S"
                    /> 
                    <FormControlLabel
                    control={
                    <Checkbox value={6} />
                    } label="S"
                    />       
                </FormGroup>
                <FormLabel component="legend">Choose your Months</FormLabel>
                <FormGroup>
                    <FormControlLabel
                    control={
                    <Checkbox value={0} />
                    } label="Jan"
                    />
                 <FormControlLabel
                    control={
                    <Checkbox value={1} />
                    } label="Feb"
                    />
                 <FormControlLabel
                    control={
                    <Checkbox value={2} />
                    } label="Mar"
                    />    
                    <FormControlLabel
                    control={
                    <Checkbox value={3} />
                    } label="Apr"
                    /> 
                    <FormControlLabel
                    control={
                    <Checkbox value={4} />
                    } label="May"
                    /> 
                    <FormControlLabel
                    control={
                    <Checkbox value={5} />
                    } label="Jun"
                    />       
                </FormGroup>
            </FormControl>
            <Button className="bg-green-600 rounded-md py-1 px-4..." type='submit'>Book</Button>
            </form>
        </div>
    );
}

export default BookingForm;
